import React, { useState } from 'react';
import { TextField, Button, Typography, Box } from '@mui/material';

const ManageMovies = () => {
  const [urlApi, setUrlApi] = useState('');

  const handleUrlInputChange = (event) => {
    setUrlApi(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Thực hiện xử lý khi người dùng submit form, ví dụ: gửi dữ liệu đến server, lưu trữ vào state, ...
    console.log('URL API phim đã nhập:', urlApi);
    // Đặt các hàm xử lý dữ liệu khác ở đây nếu cần
  };

  return (
    <Box sx={{ maxWidth: 600, mx: 'auto', mt: 4, p: 3, bgcolor: 'background.paper', boxShadow: 1, borderRadius: 4 }}>
      <Typography variant="body1" gutterBottom>
        Đây là trang quản lý phim.
      </Typography>

      <form onSubmit={handleSubmit}>
        <TextField
          label="URL API phim"
          fullWidth
          value={urlApi}
          onChange={handleUrlInputChange}
          variant="outlined"
          margin="normal"
          placeholder="Nhập URL API phim..."
        />
        <Button
          type="submit"
          variant="contained"
          color="primary"
          disableElevation
          style={{ marginTop: 16 }}
        >
          Thêm phim
        </Button>
      </form>
    </Box>
  );
};

export default ManageMovies;
